        List<Integer> rollingMaxList = new ArrayList<>();
        Deque<Integer> deque = new LinkedList<>();

        for (int i = 0; i < numbers.size(); i++) {
            // Remove elements that are out of the current window
            while (!deque.isEmpty() && deque.peekFirst() < i - 2) {
                deque.pollFirst();
            }

            // Remove elements that are smaller than the current element
            while (!deque.isEmpty() && numbers.get(deque.peekLast()) < numbers.get(i)) {
                deque.pollLast();
            }

            deque.offerLast(i);
            rollingMaxList.add(numbers.get(deque.peekFirst()));
        }

        return rollingMaxList;
    }

