        // Split the input string by spaces
        String[] words = s.split(" ");

        // Initialize a StringBuilder to store the result
        StringBuilder result = new StringBuilder();

        // Iterate through each word in the input string
        for (String word : words) {
            // Convert the word to a char array
            char[] chars = word.toCharArray();

            // Sort the characters in ascending order based on ascii value
            Arrays.sort(chars);

            // Append the sorted characters to the result StringBuilder
            result.append(chars);

            // Append a space to maintain the order of words
            result.append(" ");
        }

        // Remove the extra space at the end and convert the StringBuilder to a string
        return result.toString().trim();
    }

