        // Initialize a stack to store operands
        Stack<Integer> stack = new Stack<>();

        // Push the first operand onto the stack
        stack.push(operand.get(0));

        // Iterate through the operators and operands
        for (int i = 0; i < operator.size(); i++) {
            // Get the current operator
            String op = operator.get(i);
            // Get the next operand
            int num = operand.get(i + 1);

            // Perform the operation based on the current operator
            switch (op) {
                case "+":
                    stack.push(num);
                    break;
                case "-":
                    stack.push(-num);
                    break;
                case "*":
                    stack.push(stack.pop() * num);
                    break;
                case "/":
                    stack.push(stack.pop() / num);
                    break;
                case "**":
                    stack.push((int) Math.pow(stack.pop(), num));
                    break;
            }
        }

        // Calculate the final result by summing up all the elements in the stack
        int result = 0;
        while (!stack.isEmpty()) {
            result += stack.pop();
        }

        return result;
    }

